  \"2016-07-27T22:23:51.234738\",\n\t\"name\": \"revised-comprehensive-conservation-plan-for-the-koyukuk-northern-unit-innoko-nowitna-natio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Koyukuk, Northern Unit Innoko, and Nowitna NWRs
  for the next 15 years. This plan outlines the refuges' vision and purpose and describes
  how Koyukuk, Northern Unit Innoko, and Nowitna NWRs will contribute to the overall
  mission of the Refuge System. The plan provides an introduction to the refuges,
  an overview of the CCP process, a summary of refuge resources, goals and objectives,
  information about the management direction, and strategies for implementation and
  monitoring. Key planning issues include: wildlife management, oil activity, climate
  change, wilderness character, public use, and outreach.\",\n\t\"license_title\":
